import  GetStarted from '../GetStarted/GetStarted'
import 'bootstrap/dist/css/bootstrap.min.css';
import CBot from '../Chatbot/Chatbot';
import { MDBCol,MDBContainer } from 'mdb-react-ui-kit';
import {Navbar} from "react-bootstrap"
import DGrid from '../DocGrid/DocGrid';
import DocTable, {showDocs} from '../DocTable/DocTable';
import {useState} from 'react';
export default class Home extends Compoennt {
    //class=" bg-light"
    state = {
      showDocs:false
    }
    //const [show, setShow] = useState(false);


    updatePageState() {
      console.log("updated in Home.js")
      this.setState({showDocs:true})
    }
    render() {
      console.log("show docs is:", showDocs)
      return (
        <div className="App"  >
          <Navbar bg="primary" variant="light" className="justify-content-center">
                <h1 style={{ color: "white",flexDirection:"row",flexWrap: "wrap", }}> D.Find </h1>
          </Navbar>
          <MDBContainer style = {{display:'flex'}}>
            {showDocs ? <DocTable showDocs={this.state.showDocs} triggerParentUpdate = {this.updatePageState}/> :  <GetStarted/>}
            <MDBCol >
              <CBot/>
            </MDBCol>
          </MDBContainer>
        </div>
      );
    }

  }

